import { LEVELS } from "./levels.enum";

export class Task {
  title = "";
  description = "";
  completed = false;
  level = LEVELS.NORMAL;
  constructor(name, descriptions, completed, level) {
    this.name = name;
    this.descriptions = descriptions;
    this.completed = completed;
    this.level = level;
  }
}
